import { Container } from 'react-bootstrap';

const About = () => {
  return (
    <div>
       <Container>
          <p>Trusted By</p>
          <div className="about">
              <button>CompanyLogo</button>
              <button>CompanyLogo</button>
              <button>CompanyLogo</button>
              <button>CompanyLogo</button>
          </div>
      </Container>
    </div>
  );
}

export default About;
